import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const AddUser = () => {
  return (
    <SafeAreaView style={styles.container}>
    <View>
    </View>
    </SafeAreaView>
  )
}

export default AddUser

const styles = StyleSheet.create({})
